#include <bits/stdc++.h>using namespace std; int main() {    ios::sync_with_stdio(false);    cin.tie(nullptr);     long long n, m;    if (!(cin >> n >> m)) return 0;     long long cntN[5] = {}, cntM[5] = {};    for (int r = 0; r < 5; ++r) {        cntN[r] = n / 5 + (r > 0 && n % 5 >= r);        cntM[r] = m / 5 + (r > 0 && m % 5 >= r);    }     long long ans = 0;    for (int r = 0; r < 5; ++r)        ans += cntN[r] * cntM[(5 - r) % 5];     cout << ans << '\n';    return 0;}